package com.indigitous.musicfinder.web.rest;

import com.indigitous.musicfinder.MusicFinderApp;

import com.indigitous.musicfinder.domain.Music;
import com.indigitous.musicfinder.domain.Tag;
import com.indigitous.musicfinder.domain.Artist;
import com.indigitous.musicfinder.repository.MusicRepository;
import com.indigitous.musicfinder.service.MusicService;
import com.indigitous.musicfinder.repository.search.MusicSearchRepository;

import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;
import static org.hamcrest.Matchers.hasItem;
import org.mockito.MockitoAnnotations;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.http.MediaType;
import org.springframework.http.converter.json.MappingJackson2HttpMessageConverter;
import org.springframework.data.web.PageableHandlerMethodArgumentResolver;
import org.springframework.test.context.junit4.SpringRunner;
import org.springframework.test.util.ReflectionTestUtils;
import org.springframework.test.web.servlet.MockMvc;
import org.springframework.test.web.servlet.setup.MockMvcBuilders;
import org.springframework.transaction.annotation.Transactional;

import javax.annotation.PostConstruct;
import javax.inject.Inject;
import javax.persistence.EntityManager;
import java.util.List;

import static org.assertj.core.api.Assertions.assertThat;
import static org.springframework.test.web.servlet.request.MockMvcRequestBuilders.*;
import static org.springframework.test.web.servlet.result.MockMvcResultMatchers.*;

/**
 * Test class for the MusicResource REST controller.
 *
 * @see MusicResource
 */
@RunWith(SpringRunner.class)
@SpringBootTest(classes = MusicFinderApp.class)
public class MusicResourceIntTest {

    private static final String DEFAULT_TITLE = "AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA";
    private static final String UPDATED_TITLE = "BBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBB";

    private static final String DEFAULT_LYRICS = "";
    private static final String UPDATED_LYRICS = "";

    private static final String DEFAULT_LINK = "";
    private static final String UPDATED_LINK = "";

    @Inject
    private MusicRepository musicRepository;

    @Inject
    private MusicService musicService;

    @Inject
    private MusicSearchRepository musicSearchRepository;

    @Inject
    private MappingJackson2HttpMessageConverter jacksonMessageConverter;

    @Inject
    private PageableHandlerMethodArgumentResolver pageableArgumentResolver;

    @Inject
    private EntityManager em;

    private MockMvc restMusicMockMvc;

    private Music music;

    @PostConstruct
    public void setup() {
        MockitoAnnotations.initMocks(this);
        MusicResource musicResource = new MusicResource();
        ReflectionTestUtils.setField(musicResource, "musicService", musicService);
        this.restMusicMockMvc = MockMvcBuilders.standaloneSetup(musicResource)
            .setCustomArgumentResolvers(pageableArgumentResolver)
            .setMessageConverters(jacksonMessageConverter).build();
    }

    /**
     * Create an entity for this test.
     *
     * This is a static method, as tests for other entities might also need it,
     * if they test an entity which requires the current entity.
     */
    public static Music createEntity(EntityManager em) {
        Music music = new Music()
                .title(DEFAULT_TITLE)
                .lyrics(DEFAULT_LYRICS)
                .link(DEFAULT_LINK);
        // Add required entity
        Tag tags = TagResourceIntTest.createEntity(em);
        em.persist(tags);
        em.flush();
        music.getTags().add(tags);
        // Add required entity
        Artist artist = ArtistResourceIntTest.createEntity(em);
        em.persist(artist);
        em.flush();
        music.setArtist(artist);
        return music;
    }

    @Before
    public void initTest() {
        musicSearchRepository.deleteAll();
        music = createEntity(em);
    }

    @Test
    @Transactional
    public void createMusic() throws Exception {
        int databaseSizeBeforeCreate = musicRepository.findAll().size();

        // Create the Music

        restMusicMockMvc.perform(post("/api/music")
                .contentType(TestUtil.APPLICATION_JSON_UTF8)
                .content(TestUtil.convertObjectToJsonBytes(music)))
                .andExpect(status().isCreated());

        // Validate the Music in the database
        List<Music> music = musicRepository.findAll();
        assertThat(music).hasSize(databaseSizeBeforeCreate + 1);
        Music testMusic = music.get(music.size() - 1);
        assertThat(testMusic.getTitle()).isEqualTo(DEFAULT_TITLE);
        assertThat(testMusic.getLyrics()).isEqualTo(DEFAULT_LYRICS);
        assertThat(testMusic.getLink()).isEqualTo(DEFAULT_LINK);

        // Validate the Music in ElasticSearch
        Music musicEs = musicSearchRepository.findOne(testMusic.getId());
        assertThat(musicEs).isEqualToComparingFieldByField(testMusic);
    }

    @Test
    @Transactional
    public void checkTitleIsRequired() throws Exception {
        int databaseSizeBeforeTest = musicRepository.findAll().size();
        // set the field null
        music.setTitle(null);

        // Create the Music, which fails.

        restMusicMockMvc.perform(post("/api/music")
                .contentType(TestUtil.APPLICATION_JSON_UTF8)
                .content(TestUtil.convertObjectToJsonBytes(music)))
                .andExpect(status().isBadRequest());

        List<Music> music = musicRepository.findAll();
        assertThat(music).hasSize(databaseSizeBeforeTest);
    }

    @Test
    @Transactional
    public void getAllMusic() throws Exception {
        // Initialize the database
        musicRepository.saveAndFlush(music);

        // Get all the music
        restMusicMockMvc.perform(get("/api/music?sort=id,desc"))
                .andExpect(status().isOk())
                .andExpect(content().contentType(MediaType.APPLICATION_JSON_UTF8_VALUE))
                .andExpect(jsonPath("$.[*].id").value(hasItem(music.getId().intValue())))
                .andExpect(jsonPath("$.[*].title").value(hasItem(DEFAULT_TITLE.toString())))
                .andExpect(jsonPath("$.[*].lyrics").value(hasItem(DEFAULT_LYRICS.toString())))
                .andExpect(jsonPath("$.[*].link").value(hasItem(DEFAULT_LINK.toString())));
    }

    @Test
    @Transactional
    public void getMusic() throws Exception {
        // Initialize the database
        musicRepository.saveAndFlush(music);

        // Get the music
        restMusicMockMvc.perform(get("/api/music/{id}", music.getId()))
            .andExpect(status().isOk())
            .andExpect(content().contentType(MediaType.APPLICATION_JSON_UTF8_VALUE))
            .andExpect(jsonPath("$.id").value(music.getId().intValue()))
            .andExpect(jsonPath("$.title").value(DEFAULT_TITLE.toString()))
            .andExpect(jsonPath("$.lyrics").value(DEFAULT_LYRICS.toString()))
            .andExpect(jsonPath("$.link").value(DEFAULT_LINK.toString()));
    }

    @Test
    @Transactional
    public void getNonExistingMusic() throws Exception {
        // Get the music
        restMusicMockMvc.perform(get("/api/music/{id}", Long.MAX_VALUE))
                .andExpect(status().isNotFound());
    }

    @Test
    @Transactional
    public void updateMusic() throws Exception {
        // Initialize the database
        musicService.save(music);

        int databaseSizeBeforeUpdate = musicRepository.findAll().size();

        // Update the music
        Music updatedMusic = musicRepository.findOne(music.getId());
        updatedMusic
                .title(UPDATED_TITLE)
                .lyrics(UPDATED_LYRICS)
                .link(UPDATED_LINK);

        restMusicMockMvc.perform(put("/api/music")
                .contentType(TestUtil.APPLICATION_JSON_UTF8)
                .content(TestUtil.convertObjectToJsonBytes(updatedMusic)))
                .andExpect(status().isOk());

        // Validate the Music in the database
        List<Music> music = musicRepository.findAll();
        assertThat(music).hasSize(databaseSizeBeforeUpdate);
        Music testMusic = music.get(music.size() - 1);
        assertThat(testMusic.getTitle()).isEqualTo(UPDATED_TITLE);
        assertThat(testMusic.getLyrics()).isEqualTo(UPDATED_LYRICS);
        assertThat(testMusic.getLink()).isEqualTo(UPDATED_LINK);

        // Validate the Music in ElasticSearch
        Music musicEs = musicSearchRepository.findOne(testMusic.getId());
        assertThat(musicEs).isEqualToComparingFieldByField(testMusic);
    }

    @Test
    @Transactional
    public void deleteMusic() throws Exception {
        // Initialize the database
        musicService.save(music);

        int databaseSizeBeforeDelete = musicRepository.findAll().size();

        // Get the music
        restMusicMockMvc.perform(delete("/api/music/{id}", music.getId())
                .accept(TestUtil.APPLICATION_JSON_UTF8))
                .andExpect(status().isOk());

        // Validate ElasticSearch is empty
        boolean musicExistsInEs = musicSearchRepository.exists(music.getId());
        assertThat(musicExistsInEs).isFalse();

        // Validate the database is empty
        List<Music> music = musicRepository.findAll();
        assertThat(music).hasSize(databaseSizeBeforeDelete - 1);
    }

    @Test
    @Transactional
    public void searchMusic() throws Exception {
        // Initialize the database
        musicService.save(music);

        // Search the music
        restMusicMockMvc.perform(get("/api/_search/music?query=id:" + music.getId()))
            .andExpect(status().isOk())
            .andExpect(content().contentType(MediaType.APPLICATION_JSON_UTF8_VALUE))
            .andExpect(jsonPath("$.[*].id").value(hasItem(music.getId().intValue())))
            .andExpect(jsonPath("$.[*].title").value(hasItem(DEFAULT_TITLE.toString())))
            .andExpect(jsonPath("$.[*].lyrics").value(hasItem(DEFAULT_LYRICS.toString())))
            .andExpect(jsonPath("$.[*].link").value(hasItem(DEFAULT_LINK.toString())));
    }
}
